import { Typography,Form,Input,Button} from 'antd';
import React from 'react';
import "./Login.css"

const Login = () =>{
    return(
        <div className="appBg">
            <Form className="loginForm">
                <Typography.Title>Hoş Geldiniz</Typography.Title>
                <Form.item label="Email" name={'myEmail'}>
                    <Input placeholder="E-mail girin">
                    </Input>
                </Form.item>
                <Form.item label="Password" name={'myPassword'}>
                    <Input placeholder="Şifre girin">
                    </Input>
                </Form.item>
                <Button type='primary' htmlType='submit'>Giriş Yap</Button>
            </Form>
        </div>

    );

}
export default Login;
